import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Grid, 
  Card, 
  CardContent, 
  CardMedia,
  Button,
  Stack,
  Chip
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import VerifiedIcon from '@mui/icons-material/Verified';

// Mock data for latest drops
const latestDrops = [
  {
    id: 1,
    title: 'Abstract Thought of Art',
    creator: 'ZafGod.eth',
    price: '0.0006 ETH',
    image: 'https://via.placeholder.com/400x300/1a237e/ffffff',
    status: 'Minting',
    isVerified: true
  },
  {
    id: 2,
    title: 'Harvested Opulence',
    creator: 'Fame Identity',
    price: '0.005 ETH',
    image: 'https://via.placeholder.com/400x300/4a148c/ffffff',
    status: 'Now',
    isVerified: true
  },
  {
    id: 3,
    title: 'RELAX',
    creator: 'brain pasta',
    price: '0.0038 ETH',
    image: 'https://via.placeholder.com/400x300/311b92/ffffff',
    status: 'Completed',
    isVerified: true
  },
  {
    id: 4,
    title: 'Spring will come',
    creator: 'Reza Milani',
    price: '0.0004 ETH',
    image: 'https://via.placeholder.com/400x300/6a1b9a/ffffff',
    status: 'Completed',
    isVerified: true
  },
  {
    id: 5,
    title: 'Free Fall',
    creator: 'Emmywalkka',
    price: '0.009 ETH',
    image: 'https://via.placeholder.com/400x300/4527a0/ffffff',
    status: 'Completed',
    isVerified: true
  },
  {
    id: 6,
    title: 'SIXTEEN X NINE | WHM 2025',
    creator: 'megurashd',
    price: '0.00087 ETH',
    image: 'https://via.placeholder.com/400x300/283593/ffffff',
    status: 'Now',
    isVerified: true
  }
];

const Home = () => {
  const navigate = useNavigate();

  return (
    <Container maxWidth="xl" sx={{ mt: 4, pb: 8 }}>
      {/* Header Section */}
      <Box sx={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center',
        mb: 4
      }}>
        <Typography variant="h4" component="h1" sx={{ fontWeight: 'bold' }}>
          Latest drops
        </Typography>
        <Button 
          variant="contained" 
          onClick={() => navigate('/marketplace')}
          sx={{
            background: 'linear-gradient(45deg, #FF6B6B 30%, #FF8E53 90%)',
            borderRadius: '20px',
            textTransform: 'none',
            px: 3
          }}
        >
          Launch with Rarible
        </Button>
      </Box>

      {/* NFT Grid */}
      <Grid container spacing={3}>
        {latestDrops.map((nft) => (
          <Grid item key={nft.id} xs={12} sm={6} md={4} lg={4} xl={2}>
            <Card sx={{ 
              bgcolor: 'rgba(22, 28, 36, 0.8)',
              borderRadius: 2,
              '&:hover': {
                transform: 'translateY(-4px)',
                transition: 'all 0.3s ease-in-out',
                boxShadow: '0 4px 20px rgba(0,0,0,0.4)'
              }
            }}>
              <CardMedia
                component="img"
                height="280"
                image={nft.image}
                alt={nft.title}
                sx={{ objectFit: 'cover' }}
              />
              <CardContent>
                <Stack spacing={1}>
                  {/* Creator Info */}
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <Typography variant="subtitle2" color="text.secondary">
                      {nft.creator}
                    </Typography>
                    {nft.isVerified && (
                      <VerifiedIcon sx={{ fontSize: 16, color: '#2196f3' }} />
                    )}
                  </Box>

                  {/* NFT Title */}
                  <Typography variant="h6" component="h2" sx={{ fontWeight: 'bold' }}>
                    {nft.title}
                  </Typography>

                  {/* Price and Status */}
                  <Box sx={{ 
                    display: 'flex', 
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    mt: 1 
                  }}>
                    <Box>
                      <Typography variant="caption" color="text.secondary">
                        {nft.status === 'Minting' ? 'Minting' : 'Price'}
                      </Typography>
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold' }}>
                        {nft.price}
                      </Typography>
                    </Box>
                    <Chip 
                      label={nft.status} 
                      size="small"
                      sx={{ 
                        bgcolor: nft.status === 'Now' ? 'success.main' : 
                                nft.status === 'Completed' ? 'info.main' : 'warning.main',
                        color: 'white'
                      }}
                    />
                  </Box>
                </Stack>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* View All Button */}
      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 6 }}>
        <Button 
          variant="outlined" 
          onClick={() => navigate('/marketplace')}
          sx={{
            borderColor: 'rgba(255, 255, 255, 0.3)',
            color: 'white',
            '&:hover': {
              borderColor: 'white',
              bgcolor: 'rgba(255, 255, 255, 0.1)'
            }
          }}
        >
          View all drops →
        </Button>
      </Box>
    </Container>
  );
};

export default Home;
